import React, { useState, useEffect } from 'react';
import { Card, Row, Col, Table } from 'react-bootstrap';
import { complaintService } from '../../services/complaintService';

const Analytics = () => {
  const [stats, setStats] = useState({});
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchAnalytics();
  }, []);

  const fetchAnalytics = async () => {
    try {
      // This would typically come from a dedicated analytics endpoint
      const complaints = await complaintService.getComplaints();
      
      // Calculate basic analytics
      const totalComplaints = complaints.complaints.length;
      const resolvedComplaints = complaints.complaints.filter(c => c.status === 'resolved').length;
      const pendingComplaints = complaints.complaints.filter(c => c.status === 'pending').length;
      
      // Category distribution
      const categoryCount = complaints.complaints.reduce((acc, complaint) => {
        acc[complaint.category] = (acc[complaint.category] || 0) + 1;
        return acc;
      }, {});

      // Resolution rate
      const resolutionRate = totalComplaints > 0 ? (resolvedComplaints / totalComplaints) * 100 : 0;

      setStats({
        totalComplaints,
        resolvedComplaints,
        pendingComplaints,
        categoryCount,
        resolutionRate: resolutionRate.toFixed(1)
      });
    } catch (error) {
      console.error('Error fetching analytics:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <div>Loading analytics...</div>;
  }

  return (
    <div>
      <h3>Analytics Dashboard</h3>
      
      <Row className="mb-4">
        <Col md={3}>
          <Card className="text-center">
            <Card.Body>
              <h2 className="text-primary">{stats.totalComplaints}</h2>
              <Card.Text>Total Complaints</Card.Text>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3}>
          <Card className="text-center">
            <Card.Body>
              <h2 className="text-success">{stats.resolvedComplaints}</h2>
              <Card.Text>Resolved</Card.Text>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3}>
          <Card className="text-center">
            <Card.Body>
              <h2 className="text-warning">{stats.pendingComplaints}</h2>
              <Card.Text>Pending</Card.Text>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3}>
          <Card className="text-center">
            <Card.Body>
              <h2 className="text-info">{stats.resolutionRate}%</h2>
              <Card.Text>Resolution Rate</Card.Text>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      <Row>
        <Col md={6}>
          <Card>
            <Card.Header>
              <h5>Complaints by Category</h5>
            </Card.Header>
            <Card.Body>
              <Table>
                <thead>
                  <tr>
                    <th>Category</th>
                    <th>Count</th>
                  </tr>
                </thead>
                <tbody>
                  {Object.entries(stats.categoryCount || {}).map(([category, count]) => (
                    <tr key={category}>
                      <td>{category}</td>
                      <td>{count}</td>
                    </tr>
                  ))}
                </tbody>
              </Table>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default Analytics;
